import React, { useEffect, useState } from "react";

const AdminDashboard = () => {
  const [logs, setLogs] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3000/api/admin/logs")
      .then((res) => res.json())
      .then((data) => setLogs(data));
  }, []);

  return (
    <div>
      <h1 className="text-2xl font-bold">ðŸ›  Admin Dashboard</h1>
      <h2 className="text-xl my-4">ðŸ“œ Recent Activity Logs</h2>
      <table className="w-full border-collapse border border-gray-300">
        <thead>
          <tr className="bg-gray-200">
            <th className="border p-2">Event</th>
            <th className="border p-2">User ID</th>
            <th className="border p-2">Timestamp</th>
          </tr>
        </thead>
        <tbody>
          {logs.map((log, index) => (
            <tr key={index} className="border">
              <td className="p-2">{log.eventType}</td>
              <td className="p-2">{log.userId || "Anonymous"}</td>
              <td className="p-2">{new Date(log.timestamp).toLocaleString()}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default AdminDashboard;
